USE master
GO
CREATE DATABASE valorant_db
GO
USE valorant_db
DROP TABLE IF EXISTS Agents;
CREATE TABLE Agents (
   Agent_ID VARCHAR(15) NOT NULL PRIMARY KEY,
   agent_role VARCHAR(20)
);


-- Creating Team table

DROP TABLE IF EXISTS Team;
CREATE TABLE Team(
   Team_ID   VARCHAR(10) NOT NULL PRIMARY KEY
  ,team_Name VARCHAR(19) NOT NULL
);


-- Creating Player table

DROP TABLE IF EXISTS player;
CREATE TABLE player(
   Player_ID VARCHAR(13) NOT NULL PRIMARY KEY
  ,Team_ID   VARCHAR(10) NOT NULL
  ,Agent_ID  VARCHAR(15) NOT NULL
);

-- Created Matches table

DROP TABLE IF EXISTS Matches;
CREATE TABLE Matches(
   Match_ID    VARCHAR(18) NOT NULL PRIMARY KEY
  ,mapName     VARCHAR(15) NOT NULL
  ,gameLength  NUMERIC(30,1) NOT NULL
  ,winningTeam VARCHAR(4) NOT NULL
);

-- Creating Killer table

DROP TABLE IF EXISTS Killer;
CREATE TABLE Killer(
   Kill_ID   VARCHAR(13) NOT NULL PRIMARY KEY
  ,Killer_ID VARCHAR(13) NOT NULL
  ,Weapon_ID VARCHAR(8) NOT NULL
  ,roundNum  INTEGER  NOT NULL
  ,Match_ID  VARCHAR(18) NOT NULL
);


-- Creating Weapons Table

DROP TABLE IF EXISTS Weapons;
CREATE TABLE Weapons(
   Weapon_ID VARCHAR(8) NOT NULL PRIMARY KEY
  ,Cost      INTEGER  NOT NULL
  ,Type      VARCHAR(7) NOT NULL
);


UPDATE Weapons
SET Cost = 200
WHERE Weapon_ID = 'Knife';

UPDATE Weapons
SET Cost = 200
WHERE Weapon_ID = 'Classic';

-- Create MatchTeam table

DROP TABLE IF EXISTS MatchTeam;
CREATE TABLE MatchTeam(
   MatchTeam_ID VARCHAR(18) NOT NULL PRIMARY KEY
  ,Match_ID     VARCHAR(18) NOT NULL
  ,Team_ID      VARCHAR(10) NOT NULL
  ,side         VARCHAR(4) NOT NULL
);

-- Adding Foreign Key Constraints

-- Player Table Constraint
ALTER TABLE player
ADD CONSTRAINT FK_Player_Team
FOREIGN KEY(Team_ID) REFERENCES Team(Team_ID);

-- Killer Table Constraint
/*ALTER TABLE Killer
ADD CONSTRAINT FK_Killer_Weapons
FOREIGN KEY (Weapon_ID) REFERENCES Weapons(Weapon_ID)
*/

ALTER TABLE Killer
ADD CONSTRAINT FK_Killer_Player
FOREIGN KEY (Killer_ID) REFERENCES Player(Player_ID)

ALTER TABLE Killer
ADD CONSTRAINT FK_Killer_Match
FOREIGN KEY (Match_ID) REFERENCES Matches(Match_ID)

-- MatchTeam Table Constraint
ALTER TABLE MatchTeam
ADD CONSTRAINT FK_MatchTeam_Matches
FOREIGN KEY (Match_ID) REFERENCES Matches(Match_ID)

ALTER TABLE MatchTeam
ADD CONSTRAINT FK_MatchTeam_Teams
FOREIGN KEY (Team_ID) REFERENCES Teams(Team_ID)
